    //        "TicketNumber": 71,
    //        "NotionalProductId": 13,
    //        "NotionalValue": 200.00000000000000000000000000,
    //        "FeeAmount": 0.0000000000000000000000000000,
    //     }
    //
    // fetchWithdrawals
    //
    //     {
    //         "Amount": 0.0,
    //         "FeeAmount": 0.0,
    //         "NotionalValue": 0.0,
    //         "WithdrawId": 0,
